import React from 'react';
import styled from 'styled-components';

const FooterContainer = styled.footer`
  background-color: #333;
  color: #fff;
  padding: 1rem;
  position: absolute;
  bottom: 0;
  width: 100%;
`;

const Footer = () => {
  return <FooterContainer>&copy; {new Date().getFullYear()} My Website</FooterContainer>;
};

export default Footer;
